import Foundation

extension WalletBirthday {
    static func piratenetBirthday(with height: BlockHeight) -> WalletBirthday {
        switch height {
        case BlockHeight.min ..< 1_000_000:
            return WalletBirthday(
                height: 152_855,
                hash: "00000001500922f7db74b9d82b745f84ebec28b0d5ea00d2a8af53207f3a63c1",
                time: 1544836549,
                tree: "000000"
            )
        case 1_000_000 ..< 1_500_000:
            return WalletBirthday(
                height: 1_000_000,
                hash: "000000005ba1dab60631d4215aaf814151b20a38f33fde0dca014fefcc2c85d4",
                time: 1547686739,
                tree: ""
            )
        case 1_500_000 ..< BlockHeight.max:
            return WalletBirthday(
                height: 1_500_000,
                hash: "0000000003966e23bb72162a84d2ba0bd4ca5dbf12c4201e79629719725bc05e",
                time: 1627759610,
                tree: ""
            )
        default:
            return WalletBirthday(
                height: 1_500_000,
                hash: "0000000003966e23bb72162a84d2ba0bd4ca5dbf12c4201e79629719725bc05e",
                time: 1627759610,
                tree: ""
            )
        }
    }
}
